/**
 * Configuration settings for the Alebrije Wallet
 */

const config = {
  DEFAULT_NETWORK: {
    blockchain: 'solana',
    network: 'devnet', // Could be 'mainnet', 'devnet', or 'testnet'
  },
  API_KEYS: {
    // Add API keys here if needed
  },
  TOKEN_ACCOUNT_AUTO_CREATE: {
    enabled: false, // Default to disabled after rollback
    notifyUser: true,
    feeEstimation: true
  }
};

export default config;
